def stat_sucrate(lista,sortindex=2,binlen=1,sum=False, reversed=False):
#     parta = lista[:3]
#     partb = map(float,lista[3:])
#     parta.extend(partb)
#     lista = parta
    lista.sort(cmp=None, key=lambda x:x[sortindex], reverse=reversed)
    binlen = binlen-1
    s = binlen
    f = binlen
    result = []
    lenlista = len(lista)
    templen = 0
    for item in lista:
        if str(item[1])=='-1' or str(item[1])=='-1.0':
            f+=1
        if str(item[1])=='1' or str(item[1])=='1.0':
            s+=1
        if sum:
            if s>templen+binlen or item[0]==lista[-1][0]:
                s = float(s) if s>binlen else 0.1
                result.append([s/(s+f),item[sortindex]])
                templen = s
        else:
            if s>binlen or item[0]==lista[-1][0]:
                s = float(s) if s>binlen else 0.1
                result.append([s/(s+f),item[sortindex]])
                s = binlen
                f = binlen
    return result

